import styled from "styled-components";
export const Wrapper = styled.div`
display: flex;
justify-content: center;
`
export const RentList = styled.div`
display: flex;
width: 100%;
height: fit-content;
flex-wrap: wrap;
justify-content: center;
`

export const Rent = styled.div`
width:auto;
height: fit-content;
margin: 8px 0;
`
